import React from 'react';
import '../../App.css';
import HeroSection from '../HeroSection';
import ImageCard from '../ImageCard';
import choice from '../choice'
function Home() {
  return (
    <>
      <HeroSection />
      <ImageCard/>
      <div className='container'>
        <choice />    
      </div>   
     
    </>
  );
}

export default Home;
